import React from 'react'

const Search = ({ handleFilter, filter }) => {
  return (
    <>
      <label htmlFor="filter">Filter shown with
        <input 
          className='input-field'
          type="text" 
          name="filter" 
          id="filter" 
          onChange={handleFilter} 
          value={filter} 
        />
      </label>
    </>
  )
}

export default Search
